issue.body:
use `"hello {name}"` instead of `"hello ${name}"`
Motivation: One less char to type, more ergonomic and the `$` char had no practical use. Prefixing a `$` seems like a leftover from languages that used `$` as a var prefix (bash/php/php...). In our context we're using an **expression** inside the string interpolation so we need a start and end token (the curly braces) but anything else seems redundant.

Cons:
 * If you're coming from JS world a bit less familiar, but this can also be treated as a pro since we're trying to remove stuff from JS that never made sense anyway.
 * This means that string representation of a JS objects and OpenAPI url paths need to be escaped:
```wing
// now:
Json.parse("\{ \"a\": 1 }");
// was:
Json.parse("{ \"a\": 1 }");
// now:
api.get("/users/\{name}", handler);
// was:
api.get("/users/{name}", handler);
```

