### I tried this:

compiling this:

```
bring cloud;
class C1 {  
    inflight var i: str;
    init() {
        let api = new cloud.Api();
        api.post("/k1", inflight (req) => {
            this.i = "1";
            log("i: ${this.i}");
            return {
                status: 200
            };
        });
    }

    inflight init() {
        this.i  = "0";
    }
}
```

notice `this.i` is updated in a `cloud.Api` handler 

### This happened:

getting this error:

```
error: "i" cannot be initialized in the preflight initializer
  --> test.w:7:18
  |
7 |             this.i = "1";
  |                  ^ "i" cannot be initialized in the preflight initializer
```

### I expected this:

to compile.

